import React ,{useState}from 'react';
import Button from '@material-ui/core/Button';


const tttt= ({ visible }) => {
     const [keyword , setkeyword]=  useState ([])

     const onhandleChange =() =>{
          setkeyword = true

     }

 
    return (


        <Button variant="contained" color="secondary" onClick={onhandleChange}>
  Secondary
</Button>
      );
}
 
export default tttt;
